      const data = await apiService.getURLStats(shortcode);
      setStats(data);
      console.info(`Stats fetched for shortcode: ${shortcode}`);
      await Log("frontend", "info", "api", `Stats fetched for shortcode: ${shortcode}`);
    } catch (error) {
      console.error(`Error fetching stats: ${error.message}`);
      await Log("frontend", "error", "api", `Error fetching stats: ${error.message}`);
